//     element: <SignIn />,
//   },
//   {
//     path: "/club/:clubId",
//     element: <Club />,
//   },
// ]);

const App = () => {
  return (
    <Router>
      <Header />
      <main>
        <Routes>
          <Route path="/" element={<Home />}></Route>
          <Route path="/sign-in" element={<SignIn />}></Route>
          <Route path="/club/:clubId" element={<Club />}></Route>
        </Routes>
      </main>
      <Footer />
    </Router>
  );
}


export default App;
